package com.etc.geeks.entity.GoodsInformation;

public class GoodsLargeClass {
	private String goodsLargeClassId;//	商品大类ID
	private String goodsLargeClassName;//	商品大类名称

	public GoodsLargeClass(String goodsLargeClassId, String goodsLargeClassName) {
		super();
		this.goodsLargeClassId = goodsLargeClassId;
		this.goodsLargeClassName = goodsLargeClassName;
	}
	public GoodsLargeClass() {
		super();
		// TODO Auto-generated constructor stub
	}
	public String getGoodsLargeClassId() {
		return goodsLargeClassId;
	}
	public void setGoodsLargeClassId(String goodsLargeClassId) {
		this.goodsLargeClassId = goodsLargeClassId;
	}
	public String getGoodsLargeClassName() {
		return goodsLargeClassName;
	}
	public void setGoodsLargeClassName(String goodsLargeClassName) {
		this.goodsLargeClassName = goodsLargeClassName;
	}
	@Override
	public String toString() {
		return "Unit [goodsLargeClassId=" + goodsLargeClassId
				+ ", goodsLargeClassName=" + goodsLargeClassName + "]";
	}

}
